import React from "react";
import ReactDOM from "react-dom";
import Notes from "./notes.js";



function Note(n){
    return <div className="note">
    <h1>{n.title}</h1>
    <p>{n.content}</p>
        
    </div>
}

Notes.map( note => Note(note));


export default Note;
